import React, { useState, useEffect} from "react";
import { getUsers, deleteUser } from "../api";
import './Liste.css'

function Liste() {

    const [users, setUsers] = useState([]);

    useEffect(() => {
        getAllUsers();
    }, []);

    const getAllUsers = async (user) => {
        let response = await getUsers(user);
        setUsers(response.data);
    }
    const deleteOneUser= async (id)=>{
        deleteUser()
    }

    return (
        <div>
            <table>
                <tbody>
                    <tr>
                        <th>Prenom</th>
                        <th>Nom</th>
                        <th>Sexe</th>
                        <th>Numreo</th>
                        <th>Age</th>
                        <th>Adress</th>
                        <th>Poids</th>
                        <th>Pression Arterielle</th>
                        <th>Symptome 1</th>
                        <th>Symptome 2</th>
                        <th>Symptome 3</th>
                        <th>Modifier</th>
                        <th>Supprimer</th>
                    </tr>  
                {users.map((user, index) => (
                    <tr key={index}>
                        <td><div>{user.prenom}</div></td>
                        <td><div>{user.nom}</div></td>
                        <td><div>{user.sexe}</div></td>
                        <td><div>{user.numero}</div></td>                            
                        <td><div>{user.age}</div></td>
                        <td><div>{user.address}</div></td>
                        <td><div>{user.poids}</div></td>
                        <td><div>{user.pression_arterielle}</div></td>
                        <td><div>{user.symptome_1}</div></td>
                        <td><div>{user.symptome_2}</div></td>
                        <td><div>{user.symptome_3}</div></td>
                        <td><div><button className="edit" onClick={()=>deteteOneUser}>edit</button></div></td>
                        <td><div><button className="delete">delete</button></div></td>
                    </tr>
                ))}
                </tbody>
            </table>



